import React from "react";
import AppRoutes from "./Routes/Routes";
import { Route, Routes } from "react-router-dom";


function App() {
  return (
    <Routes>
        <Route path="/" element={<HomePage/>} >
          <Route index element={<HomePage/>}/>
        </Route>
      </Routes>
  );
}

export default App;
